generated.css:
.btns-wrap,
body {
  font-family: Roboto, sans-serif;
}

body {
  margin: 0;
  overflow: hidden;
  background: #000;
}

.main {
  position: relative;
}

.a-enter-vr-button {
  display: none !important;
}

.btn {
  user-select: none;
  cursor: pointer;
  box-sizing: border-box;
  margin: 9px 0 10px;
  width: 50px;
  height: 40px;
  background: #f45;
  display: inline-block;
  text-align: center;
  padding: 8px 15px;
  transition: all 0.2s;
}

.custom-button {
  width: 50px;
}

#content {
  z-index: 9999;
  margin-top: 50px;
  padding: 10px 29px 26px;
  min-width: 300px;
  max-width: 400px;
  display: block;
  background: #fff;
  position: fixed;
  transform: translate(-50%, -50%);
  top: 40%;
  left: 50%;
  filter: alpha(opacity=80);
  -moz-opacity: 0.8;
  -khtml-opacity: 0.8;
  opacity: 0.8;
}

#content p {
  font-weight: 300;
  color: #000;
  font-size: 2em;
  line-height: 1.3em;
}

.gotit {
  text-align: center;
  width: 80px;
  font-size: 1.2em;
  color: #ffffff;
}

.links {
  color: #0078ff;
}

#header {
  background-color: #ffff;
  filter: alpha(opacity=80);
  -moz-opacity: 0.8;
  -khtml-opacity: 0.8;
  opacity: 0.8;
  color: #000;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 50px;
  padding: 0;
  margin: 0;
}

#header #header-content {
  margin: 15px;
  font-size: 1.2em;
}
